import { useReducer } from 'react'

const notifReducer = (state, action) => {
  switch (action.type) {
    case "CHANGE":
        return action.payload
    case "HIDE":
        return ''
    default:
        return state
  }
}

const Notification = () => {
  const [counter, counterDispatch] = useReducer(counterReducer, 0)
  
